import React from 'react'
import Header from '../layout/Header'
import Contents from '../layout/Contents'
import Footer from '../layout/Footer'
import PorCont from '../includes/PorCont'

//함수형 컴퍼넌트랑 클래스 컴퍼넌트 컴퍼넌트는 두종류
//함수형과 클래스 장점을 
//함수(실행문) 클래스(실행문) -> 함수형컴퍼넌트를 더 많이 씀

function Portfolio() {
  return (
    <>
      <Header/>
      <Contents>
        <PorCont/>
      </Contents>
      <Footer/>
    </>
  )
}

export default Portfolio
